import React from "react";
import Cookies from "js-cookie";
//import { HealmeLogo } from "../../../constants/constants";
//import { HomePagePic } from "../../../constants/constants";
import { useEffect } from "react";
import "./_doctor-dashboard.css";


const Viewdoctorappointment:React.FC = () => {

    var usr =Cookies.get("docname");
    const viewdocappoin =()=>{
        window.location.href = '/view_doc_appointment';
    }
    const LogOut = ()=>{
        Cookies.set("docname","err");
        window.location.href = '/doctor_login';
    }
    const SetTiming = ()=>{
        window.location.href = '/doctor_set_timing';
    }
    useEffect(() => {
        //Runs on every render
        usr=Cookies.get("docname");
        if(usr==="err"){
            window.location.href = '/doctor_login';
        }
      });
    
      return (
        <div className="home-page-container">
        <div className="header-container">
            <div className="logo-container">
                <img className="logo-img" src={HealmeLogo} alt="Logo" />
            </div>
            <button type="button" className="doctor-btn" onClick={Logout}>
                         Log out
                    </button>
                    <button type="button" className="doctor-btn" onClick={Godash}>
                         home
                    </button>
        </div>
        
        <div className="body-container" id='list'>
            {data.map((item, index) => (
            <div className="doctor-confirm-panel" key={index}>
                    <div className="doc-photo">
                        <img className="doc" src={DocPic} alt="Pic of the doctor" />
                    </div>
                    <div className="appointment-description">
                        <div>
                            {item.name}
                        </div>
                        <div>
                            {item.time}
                        </div>
                        <div>
                            {item.date}
                        </div>
                        <div>
                            {item.special}
                        </div>
                    </div>
                    <button type="button" className="doctor-btn" onClick={()=>deleteappointment(item.name,item.time,item.date)}>
                         delete
                    </button>
            </div>
            ))}


        </div>
       
    </div>
    )
}

export default Viewdoctorappointment;
